package com.shhatrat.loggerek.api.model

import com.shhatrat.loggerek.api.model.GeocacheType.*
import kotlinx.serialization.json.Json

class GeocacheMock{

    val globalJson = Json {
        ignoreUnknownKeys = true
        isLenient = true
        prettyPrint = true
    }

    fun getByType(type: GeocacheType):Geocache{
        return when(type){
            Traditional -> tranditional()
            Multi -> multi()
            Quiz -> quiz()
            Moving -> moving()
            Virtual -> virtual()
            Other -> other()
            Own -> own()
            Webcam -> webcam()
            Event -> event()
        }
    }

    private fun decode(json: String):Geocache{
        return globalJson.decodeFromString<Geocache>(json)
    }

