    fun multi() : Geocache{
        return decode("{\"code\":\"OP1B2F\",\"name\":\"Zabytkowy wiadukt kratownicowy\",\"location\":\"54.389|18.5925\",\"status\":\"Available\",\"url\":\"https:\\/\\/opencaching.pl\\/viewcache.php?wp=OP1B2F\",\"difficulty\":2.5,\"terrain\":1.5,\"size2\":\"micro\",\"date_hidden\":\"2009-06-02T00:00:00+02:00\",\"founds\":111,\"notfounds\":4,\"rating\":5,\"recommendations\":14,\"req_passwd\":false,\"type\":\"Multi\",\"owner\":{\"uuid\":\"2513FD01-A606-42F7-581C-92E3B23BF470\",\"username\":\"Highlander\",\"profile_url\":\"https:\\/\\/opencaching.pl\\/viewprofile.php?userid=6229\"},\"description\":\"<p style=\\\"text-align: center;\\\"><img src=\\\"https:\\/\\/opencaching.pl\\/upload\\/26F83CDF-3D97-C0D7-D523-54DBCCCDA10A.jpg\\\" width=\\\"480\\\" style=\\\"padding: 5px; border-style:solid; border-width:1px; border-color: #8C9E65; border-radius:15px;\\\" \\/><br \\/>\\n<i>Historia opowiedziana w fotografiach<\\/i><\\/p>\\n<p align=\\\"justify\\\"><b>Miejsce<\\/b><\\/p>\\n<p align=\\\"justify\\\">Oto kalendarium zabytkowego wiaduktu kratownicowego, kt\\u00f3remu po\\u015bwi\\u0119ci\\u0142em niniejsz\\u0105 skrytk\\u0119:<\\/p>\\n<ul>\\n<li style=\\\"list-style: none\\\">1910 - W pobli\\u017cu przysz\\u0142ego wiaduktu powstaje <a title=\\\"Lotnisko\\\" href=\\\"http:\\/\\/www.danzig-online.pl\\/luft\\/flug.html\\\" target=\\\"_blank\\\">lotnisko wojskowe<\\/a><\\/li>\\n<li style=\\\"list-style: none\\\">1914 - Wybudowanie wiaduktu, ulica poprowadzona po nim nazywa si\\u0119 po prostu \\\"Flughafenstrasse\\\"<\\/li>\\n<li style=\\\"list-style: none\\\">1923 - Wiadukt stanowi dojazd do cywilnego dworca lotniczego Wolnego Miasta Gda\\u0144ska<\\/li>\\n<li style=\\\"list-style: none\\\">1945 - Pierwsza zmiana <a title=\\\"instytut Ulicologii\\\" href=\\\"http:\\/\\/www.rzygacz.webd.pl\\/index.php\\\" target=\\\"_blank\\\">nazwy wiaduktowej ulicy<\\/a> - na \\\"Pilot\\u00f3w\\\"<\\/li>\\n<li style=\\\"list-style: none\\\">1960 - Ostatni remont wiaduktu przed awari\\u0105 z 2004 roku<\\/li>\\n<li style=\\\"list-style: none\\\">1990 - Druga zmiana nazwy wiaduktowej ulicy - na \\\"Braci Lewoniewskich\\\"<\\/li>\\n<li style=\\\"list-style: none\\\">2004 - <a title=\\\"Awaria\\\" href=\\\"http:\\/\\/www.3miasta.pl\\/Newsj-5--News-off-show-4828--.html\\\" target=\\\"_blank\\\">Powa\\u017cna awaria dolnej konstrukcji wiaduktu<\\/a> zablokowa\\u0142a ruch kolejowy na ponad dob\\u0119 i samochodowy na 51 dni<\\/li>\\n<li style=\\\"list-style: none\\\">2006 - <a title=\\\"Remont\\\" href=\\\"http:\\/\\/www.zie.pg.gda.pl\\/~dwisnie\\/drogi\\/zdje\\/lew\\/lew.html\\\" target=\\\"_blank\\\">Gruntowny remont wiaduktu<\\/a> w efekcie kt\\u00f3rego wymieniono ca\\u0142y pomost, przywr\\u00f3cono mu b\\u0142ekitny kolor i wykonano iluminacj\\u0119 kratownicy<\\/li>\\n<\\/ul>\\n<p style=\\\"justify\\\">Ciekawostk\\u0105 zwi\\u0105zan\\u0105 z remontem wiaduktu jest fakt \\u017ce ca\\u0142a kratownica zosta\\u0142a odci\\u0119ta od starego pomostu i na czas jego wymiany na nowy zosta\\u0142a podniesiona 2 metry w g\\u00f3r\\u0119. \\u015aladem po operacji jej ponownego \\u0142\\u0105czenia z pomostem s\\u0105 dodatkowe blachy z du\\u017c\\u0105 ilo\\u015bci\\u0105 \\u015brub widoczne na wysoko\\u015bci oko\\u0142o metra na ka\\u017cdym filarze kratownicy.<\\/p>\\n<p style=\\\"justify\\\"><b>Bracia Lewoniewscy<\\/b>, kt\\u00f3rzy obj\\u0119li partonat nad ulic\\u0105 w 1990 roku, byli znanymi lotnikami z okresu XX-lecia mi\\u0119dzywojennego. Los chcia\\u0142 \\u017ce rozdzieli\\u0142a ich granica pa\\u0144stwowa. <a title=\\\"J\\u00f3zef\\\" href=\\\"http:\\/\\/pl.wikipedia.org\\/wiki\\/J%C3%B3zef_Lewoniewski\\\" target=\\\"_blank\\\">M\\u0142odszy J\\u00f3zef<\\/a> robi\\u0142 karier\\u0119 w Polsce, s\\u0142u\\u017c\\u0105c od 1919 w szeregach Wojska Polskiego, najpierw jako u\\u0142an (!), p\\u00f3\\u017aniej pilot my\\u015bliwski a na koniec jako cywilny pilot oblatywacz. Jego <a title=\\\"Zygmunt\\\" href=\\\"http:\\/\\/pl.wikipedia.org\\/wiki\\/Zygmunt_Lewoniewski\\\" target=\\\"_blank\\\">starszy brat Zygmunt<\\/a> w tym samym czasie dowodzi\\u0142 oddzia\\u0142ami Armii Czerwonej, oblatywa\\u0142 samoloty kupione przez ZSRR od USA i zosta\\u0142 Bohaterem Zwi\\u0105zku Radzieckiego. Obaj zgin\\u0119li w latach 30-tych w wypadkach podczas ekstremalnych wypraw lotniczych, najpierw J\\u00f3zef, potem Zygmunt. Dziwne \\u017ce niepodleg\\u0142a Polska opr\\u00f3cz J\\u00f3zefa uczci\\u0142a pami\\u0119\\u0107 jego brata-bolszewika.<\\/p>\\n<p align=\\\"justify\\\"><b>Skrytka<\\/b><\\/p>\\n<p style=\\\"justify\\\">Skrytka to multicache sk\\u0142adaj\\u0105cy si\\u0119 z po\\u015bredniego punktu wirtualnego - wiaduktu, kt\\u00f3rego \\u015brodek wskazuj\\u0105 wsp\\u00f3\\u0142rz\\u0119dne. Dokonuj\\u0105c uwa\\u017cnej wizji lokalnej wiaduktu zbierzesz <b>komplet informacji<\\/b> ujawniaj\\u0105cych wsp\\u00f3\\u0142rz\\u0119dne fina\\u0142owej skrytki:<\\/p>\\n<ul>\\n<li style=\\\"list-style: none\\\"><b>A<\\/b> - Ile najwi\\u0119cej wierzcho\\u0142k\\u00f3w tr\\u00f3jk\\u0105t\\u00f3w styka si\\u0119 w jednym miejscu w konstrukcji wiaduktu (tr\\u00f3jk\\u0105ty tworzone przez stalowe filary i \\u0142\\u0105czenia)<\\/li>\\n<li style=\\\"list-style: none\\\"><b>B<\\/b> - Ilo\\u015b\\u0107 liter w nazwie huty kt\\u00f3ra wykona\\u0142a elementy wiaduktu w 1914 roku<\\/li>\\n<li style=\\\"list-style: none\\\"><b>C<\\/b> - Numer partii stalowych element\\u00f3w wiaduktu wykonanych w 1914 roku (mniejsza liczba)<\\/li>\\n<li style=\\\"list-style: none\\\"><b>D<\\/b> - Numer partii stalowych element\\u00f3w wiaduktu wykonanych w 1914 roku (wi\\u0119ksza liczba)<\\/li>\\n<li style=\\\"list-style: none\\\"><b>E<\\/b> - Ilo\\u015b\\u0107 lat kt\\u00f3ra up\\u0142yn\\u0119\\u0142a pomi\\u0119dzy budow\\u0105 a ostatnim remontem wiaduktu<\\/li>\\n<\\/ul>\\n<p style=\\\"justify\\\">Dla u\\u0142atwienia podaj\\u0119 \\u017ce suma powy\\u017cszych pi\\u0119ciu liczb wynosi <b>170<\\/b>. Za\\u0142\\u0105czony jest r\\u00f3wnie\\u017c spoiler pokazuj\\u0105cy jak wg autora liczymy tr\\u00f3jk\\u0105ty.<\\/p>\\n<p style=\\\"justify\\\">Skrytk\\u0119 fina\\u0142ow\\u0105 znajdziesz pod nast\\u0119puj\\u0105cymi wsp\\u00f3\\u0142rz\\u0119dnymi:<\\/p>\\n<ul>\\n<li style=\\\"list-style: none\\\"><b>N 54 23.{ A + (A * B) + (2 * C) + (2 * D) + E + 1 }<\\/b><\\/li>\\n<li style=\\\"list-style: none\\\"><b>E 18 35.{ 2 * ( (A * B) + C + D + E ) + 6 }<\\/b><\\/li>\\n<\\/ul>\\n<br \\/>\\n<br \\/>\\n<p><a href=\\\"http:\\/\\/s09.flagcounter.com\\/more\\/CRE\\\"><img src=\\\"http:\\/\\/s09.flagcounter.com\\/count\\/CRE\\/bg=FFFFFF\\/txt=000000\\/border=CCCCCC\\/columns=6\\/maxflags=12\\/viewers=Geocachers\\/labels=1\\/\\\" alt=\\\"free counters\\\" border=\\\"0\\\" \\/><\\/a><br \\/>\\n<br \\/><\\/p>\\n\\n<p><em>Opis <a href='https:\\/\\/opencaching.pl\\/viewcache.php?cacheid=6961'>skrzynki<\\/a> pochodzi z serwisu <a href='https:\\/\\/opencaching.pl\\/'>Opencaching.PL<\\/a>.<\\/em><\\/p>\",\"hint\":\"\",\"latest_logs\":[{\"uuid\":\"8ed9a953-165b-411e-a12d-25ac5dc520dc\",\"date\":\"2022-09-11T14:18:03+02:00\",\"type\":\"Found it\",\"comment\":\"Niedzielne keszowanie z PsychoPatk\\u0105 :) Poszukiwanie liczb i obliczenia posz\\u0142y szybko i sprawnie. Kordy by\\u0142y dok\\u0142adne i pojemnik namierzyli\\u015bmy w kilka chwil, dok\\u0142adniej to PsychoPatka namierzy\\u0142a ;)<br \\/>\\nPrzyjemny keszyk. Dzi\\u0119ki za pokazanie miejsca. TFTC!\",\"user\":{\"uuid\":\"C151B1A8-BE97-866C-D081-97FF5A2119DF\",\"username\":\"Dex\",\"profile_url\":\"https:\\/\\/opencaching.pl\\/viewprofile.php?userid=127209\"}},{\"uuid\":\"ad99403b-85c7-4a97-85e1-aedcbafece71\",\"date\":\"2022-09-11T14:17:53+02:00\",\"type\":\"Found it\",\"comment\":\"Kesz wisia\\u0142 na mapie ju\\u017c d\\u0142ugi, d\\u0142ugi czas. Kiedy\\u015b nawet by\\u0142am na miejscu znale\\u017a\\u0107 potrzebne liczby, ale bez sukcesu. Dzisiaj skusi\\u0142a \\u0142adna pogoda i z Dexem ruszyli\\u015bmy na poszukiwania. O dziwo posz\\u0142o bardzo