    fun quiz() : Geocache{
        return decode("{\"code\":\"OP24E9\",\"name\":\"W\\u0105w\\u00f3z Czarownic i Wodospad \",\"location\":\"49.77755|20.975867\",\"status\":\"Available\",\"url\":\"https:\\/\\/opencaching.pl\\/viewcache.php?wp=OP24E9\",\"difficulty\":2,\"terrain\":2.5,\"size2\":\"regular\",\"date_hidden\":\"2010-04-04T00:00:00+02:00\",\"founds\":30,\"notfounds\":10,\"rating\":5,\"recommendations\":3,\"req_passwd\":false,\"type\":\"Quiz\",\"owner\":{\"uuid\":\"5C1EADBF-21E9-4BC7-DB3C-531B3490E73C\",\"username\":\"legokid\",\"profile_url\":\"https:\\/\\/opencaching.pl\\/viewprofile.php?userid=12513\"},\"description\":\"<p><em>W\\u0105w\\u00f3z Czarownic<\\/em> po\\u0142o\\u017cony jest w pobli\\u017cu rezerwatu <strong>\\\"Skamienia\\u0142e Miasto\\\"<\\/strong>. Prowadzi do niego szlak niebieski. W\\u0105w\\u00f3z g\\u0142\\u0119boki na 15-25 metr\\u00f3w i d\\u0142ugi na oko\\u0142o 70m, wy\\u017c\\u0142obiony jest w gruboziarnistych piaskowcach ci\\u0119\\u017ckowickich. Dno w\\u0105wozu jest w\\u0105skie z licznymi progami skalnymi, zamkni\\u0119te z jednej strony kaskad\\u017a wodn\\u0105 o wysoko\\u015bci ok. 10 m, utworzon\\u0105 przez wod\\u0119 p\\u0142yn\\u0105cego strumienia, kt\\u00f3ra w zimie tworzy fantastyczn\\u0105 lodow\\u0105 \\u015bcian\\u0119. Pionowe opadaj\\u0105ce \\u015bciany z licznymi sp\\u0119kaniami i szczelinami oraz p\\u00f3\\u0142kami skalnymi i wyst\\u0119pami poro\\u015bni\\u0119te s\\u0105 ro\\u015blinno\\u015bci\\u0105, w\\u015br\\u00f3d kt\\u00f3rej jest wiele gatunk\\u00f3w rzadkich i chronionych. Legenda m\\u00f3wi, \\u017ce tutaj \\\"<em>czarownice ze swoimi diabelskimi kamratami sw\\u00f3j sabat odbywaj\\u0105<\\/em>\\\" i st\\u0105d bierze si\\u0119 nazwa w\\u0105wozu.<\\/p>\\n<p><em>Wodospad<\\/em> jest to bardzo malownicza, pionowa \\u015bciana skalna o wysoko\\u015bci ok. 10 m, po kt\\u00f3rej sp\\u0142ywa kaskada wody z potoku Ostruszanki. Najlepiej ogl\\u0105da\\u0107 <em>Wodospad<\\/em> w czasie znacznego przyboru wody, bo innych okresach jest to tylko cienka stru\\u017cka wody. Bardzo ciekawie natomiast prezentuje si\\u0119 <em>Wodospad<\\/em> zim\\u0105, kiedy to sp\\u0142ywaj\\u0105ca woda zamarza, tworz\\u0105c widowiskow\\u0105 kaskad\\u0119 lodu.<br \\/>\\nJak z wi\\u0119kszo\\u015bci\\u0105 ska\\u0142ek i z tym miejscem zwi\\u0105zana jest legenda. M\\u00f3wi ona, \\u017ce pocz\\u0105tek strumykowi daj\\u0105 \\u0142zy rozpaczy dziewczyny wydanej przez Cieszka, wbrew prawu go\\u015bcinno\\u015bci, rycerzowi z Ro\\u017cnowa. Nieszcz\\u0119\\u015bliwa dziewczyna, \\u015bpi\\u0105c w skalnej pieczarze, nadal wylewa strumienie \\u0142ez.<\\/p>\\n<p>Wsp\\u00f3\\u0142rz\\u0119dne wskazuj\\u0105 na parking, gdzie mo\\u017cna zostawi\\u0107 samoch\\u00f3d i uda\\u0107 si\\u0119 w ok. 15-minutow\\u0105 w\\u0119dr\\u00f3wk\\u0119. Id\\u0105c w stron\\u0119 ko\\u0144ca w\\u0105wozu ( bed\\u0105cego jednocze\\u015bnie wodospadem ) szukaj po prawej stronie miejsca ze zdj\\u0119cia nr 4. Tam schowany jest kesz.<\\/p>\\n<p>Gor\\u0105co zach\\u0119cam do zwiedzenia ca\\u0142ego <em>Skamienia\\u0142ego Miasta<\\/em>.<\\/p>\\n<p>W <em>Skamienia\\u0142ym Mie\\u015bcie<\\/em> znajduj\\u0105 si\\u0119 skrzynki <a href=\\\"https:\\/\\/opencaching.pl\\/viewcache.php?cacheid=1938\\\"><strong>OP0790<\\/strong><\\/a> oraz <a href=\\\"https:\\/\\/opencaching.pl\\/viewcache.php?cacheid=9450\\\"><strong>OP24E7<\\/strong><\\/a> do kt\\u00f3rych szukania zach\\u0119cam.<\\/p>\\n<span style=\\\"font-size: small;\\\"><strong><span style=\\\"color: #ff0000;\\\">UWAGA<\\/span><span style=\\\"color: #ff0000;\\\">:<\\/span><\\/strong><\\/span> Przy podejmowaniu skrzynki prosz\\u0119 o ostro\\u017cno\\u015b\\u0107, ze wzgl\\u0119du na du\\u017c\\u0105 liczb\\u0119 turyst\\u00f3w odwiedzaj\\u0105cych to miejsce.\\n<p>\\u00a0<\\/p>\\n\\n<p><em>Opis <a href='https:\\/\\/opencaching.pl\\/viewcache.php?cacheid=9452'>skrzynki<\\/a> pochodzi z serwisu <a href='https:\\/\\/opencaching.pl\\/'>Opencaching.PL<\\/a>.<\\/em><\\/p>\",\"hint\":\"\",\"latest_logs\":[{\"uuid\":\"384e9f6b-456d-4c45-b1e8-bdf93a31f2f5\",\"date\":\"2024-08-13T11:51:17+02:00\",\"type\":\"Didn't find it\",\"comment\":\"W dziurze niestety pusto, ale miejsce \\u015bwietne!\",\"user\":{\"uuid\":\"A3D55C9E-B802-C429-E89D-C88F50BDDB34\",\"username\":\"Jedeek\",\"profile_url\":\"https:\\/\\/opencaching.pl\\/viewprofile.php?userid=154374\"}},{\"uuid\":\"8d6b5322-7d69-485a-be39-b03fda287498\",\"date\":\"2024-07-08T11:05:09+02:00\",\"type\":\"Found it\",\"comment\":\"Niestety miejsce by\\u0142o puste ale tak si\\u0119 z\\u0142o\\u017cy\\u0142o \\u017ce mia\\u0142em \\u017ce sob\\u0105 ma\\u0142y pojemnik. Dodatkowo zostawi\\u0142em \\u015bwie\\u017cego geokreta i prowizoryczny logbook.<br \\/>\\n<br \\/>\\nMam nadziej\\u0119 \\u017ce pier\\u015bcie\\u0144 przeb\\u0119dzie ciekaw\\u0105 podr\\u00f3\\u017c.\",\"user\":{\"uuid\":\"9226A5E6-FB65-C6BB-35F6-6DDDEFB6FEF0\",\"username\":\"gszajna@gmail.com\",\"profile_url\":\"https:\\/\\/opencaching.pl\\/viewprofile.php?userid=155052\"}},{\"uuid\":\"9ecfc10c-622f-484f-ad92-688143a08bd9\",\"date\":\"2022-08-15T14:56:35+02:00\",\"type\":\"Found it\",\"comment\":\"\",\"user\":{\"uuid\":\"00ACEDB6-5871-FFEB-9742-0065F81CCBA4\",\"username\":\"Ania i Hubert\",\"profile_url\":\"https:\\/\\/opencaching.pl\\/viewprofile.php?userid=60209\"}},{\"uuid\":\"72127754-4605-4ff3-9891-9c63ac44338e\",\"date\":\"2022-05-21T15:30:21+02:00\",\"type\":\"Found it\",\"comment\":\"Robi wra\\u017cenie cho\\u0107 wody nie za wiele lecia\\u0142o. Kesz w porz\\u0105dku. <br \\/>\\nWycieczka z Chochlikiem na Skalne Miasto. Dzi\\u0119ki za chwil\\u0119 rado\\u015bci z keszem :-)\",\"user\":{\"uuid\":\"BDEF8BEA-D7A1-873F-D569-69CA2F5484F8\",\"username\":\"ForgottenSilesia\",\"profile_url\":\"https:\\/\\/opencaching.pl\\/viewprofile.php?userid=46036\"}},{\"uuid\":\"d3d29cc8-7d1c-453f-b534-e3a83e2b3f1e\",\"date\":\"2022-05-21T12:31:59+02:00\",\"type\":\"Found it\",\"comment\":\"Przepi\\u0119kne miejsce. Naprawd\\u0119 warto tu zajrze\\u0107. Keszyk znaleziony razem z ForgottenSilesia.<br \\/>\\nDzi\\u0119ki :)\",\"user\":{\"uuid\":\"650C6DF9-D46F-B90D-4794-42B119EFA902\",\"username\":\"Chochlik.\",\"profile_url\":\"https:\\/\\/opencaching.pl\\/viewprofile.php?userid=32851\"}},{\"uuid\":\"3ddc6aaf-b76d-43cc-a1b3-a93770e636c9\",\"date\":\"2022-03-09T13:22:39+01:00\",\"type\":\"Found it\",\"comment\":\"Dzi\\u0119ki za kesza. Wiksmartos12 \",\"user\":{\"uuid\":\"5761B749-7884-6C2A-E657-4E67DD43B258\",\"username\":\"Wiksmartos12\",\"profile_url\":\"https:\\/\\/opencaching.pl\\/viewprofile.php?userid=86786\"}},{\"uuid\":\"a8d72335-e303-4131-903a-7c20f330409e\",\"date\":\"2022-03-09T13:20:47+01:00\",\"type\":\"Found it\",\"comment\":\"Skrzyneczka na miejscu. Dzi\\u0119kuj\\u0119 za kesza.\",\"user\":{\"uuid\":\"09F5081A-88C2-D5AB-E623-AC2C73D1F983\",\"username\":\"luka128\",\"profile_url\":\"https:\\/\\/opencaching.pl\\/viewprofile.php?userid=12705\"}},{\"uuid\":\"5E3E9F10-CF3F-F2B9-215C-8F449CB36A78\",\"date\":\"2021-07-17T12:50:00+02:00\",\"type\":\"Found it\",\"comment\":\"<p>Byli\\u015bmy zaskoczeni jak pi\\u0119kne jest to miejsce. Jest to chyba jeden z najpi\\u0119kniejszych zak\\u0105tk\\u00f3w w Polsce,<\\/p>\\r\\n<p>Cudowne w\\u0105w\\u00f3z z wodospadem. Dzi\\u0119kujemy.<\\/p>\",\"user\":{\"uuid\":\"65804DB8-FDD0-43BD-AFDC-5BB89BA2B620\",\"username\":\"GFS\",\"profile_url\":\"https:\\/\\/opencaching.pl\\/viewprofile.php?userid=24076\"}},{\"uuid\":\"286EA41C-F780-AB4F-8074-11D6BFA616C9\",\"date\":\"2021-07-17T12:50:00+02:00\",\"type\":\"Maintenance performed\",\"comment\":\"<p>Zdecydowanie miejsce ukrycia by\\u0142o puste. Zostawi\\u0142em ma\\u0142y pojemnik w pierwotnym miejscu, bo miejsce zdecydowanie zas\\u0142uguje na skrzynk\\u0119.<\\/p>\",\"user\":{\"uuid\":\"65804DB8-FDD0-43BD-AFDC-5BB89BA2B620\",\"username\":\"GFS\",\"profile_url\":\"https:\\/\\/opencaching.pl\\/viewprofile.php?userid=24076\"}},{\"uuid\":\"b4cc79f7-0e49-4a2d-b459-589616c05c1c\",\"date\":\"2021-07-12T14:00:0